import axios from "axios";
import { useState } from "react";
import toast from "react-hot-toast";
import { Link } from "react-router-dom";
import CompletingManager from "../CompletingManager";

function Details() {
  const [allDetails, setAllDetails] = useState({ managers: [], restaurants: [] });
  const [loading, setLoading] = useState(false);

  const getData = async () => {
    setLoading(true);
    try {
      const [managersResponse, restaurantsResponse] = await Promise.all([
        axios.get("http://localhost:4000/api/auth/getmanagers"),
        axios.get("http://localhost:4000/api/auth/getrestaurants"),
      ]);

      if (managersResponse.data.success && restaurantsResponse.data.success) {
        toast.success("Data fetched successfully!");
        setAllDetails({
          managers: managersResponse.data.managers || [],
          restaurants: restaurantsResponse.data.restaurants || [],
        });
      } else {
        toast.error("Failed to fetch data.");
      }
    } catch (error) {
      console.error("Error fetching data:", error);
      toast.error("Error fetching data. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen w-full bg-gradient-to-br from-gray-100 via-blue-50 to-blue-100 p-5">
      <div className="max-w-7xl mx-auto">

        {/* Heading */}
        <h1 className="text-5xl text-center font-extrabold text-gray-800 mb-12 drop-shadow-lg">
          Welcome to Our Partner Portal
        </h1>

        {/* Top Buttons */}
        <div className="flex justify-center gap-5 mb-12">
          <button
            onClick={getData}
            className={`px-10 py-4 rounded-full text-white font-semibold text-lg transition-all duration-300 shadow-lg ${
              loading
                ? "bg-gray-400 cursor-not-allowed"
                : "bg-gradient-to-r from-blue-500 to-blue-700 hover:scale-105"
            }`}
            disabled={loading}
          >
            {loading ? "Loading..." : "Fetch Data"}
          </button>

          <Link to="/admin">
            <button className="bg-gradient-to-r from-green-400 to-green-600 px-10 py-4 rounded-full text-white font-semibold text-lg shadow-lg transition-transform hover:scale-105">
              Admin Panel
            </button>
          </Link>
        </div>

        {/* Completing Manager Section */}
        <CompletingManager />

        {/* Manager Details */}
        <div className="mb-14 bg-white/60 rounded-xl p-8 shadow-xl">
          <h2 className="text-3xl font-bold text-blue-700 mb-8">Manager Details</h2>
          {allDetails.managers.length > 0 ? (
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-10">
              {allDetails.managers.map((manager) => (
                <div key={manager._id} className="bg-white p-6 rounded-2xl shadow-lg border border-gray-200 hover:shadow-xl transition-all duration-300">
                  <p><strong>Name:</strong> {manager.Name}</p>
                  <p><strong>Aadhaar Number:</strong> {manager.AdharNumber}</p>
                  <p><strong>Phone Number:</strong> {manager.PhoneNumber}</p>
                  <p><strong>PAN Number:</strong> {manager.PanNumber}</p>
                </div>
              ))}
            </div>
          ) : (
            <p className="text-gray-600">No managers found.</p>
          )}
        </div>

        {/* Restaurant Details */}
        <div className="bg-white/60 rounded-xl p-8 shadow-xl">
          <h2 className="text-3xl font-bold text-blue-700 mb-8">Restaurant Details</h2>
          {allDetails.restaurants.length > 0 ? (
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-10">
              {allDetails.restaurants.map((restaurant) => (
                <div key={restaurant._id} className="bg-white p-6 rounded-2xl shadow-lg border border-gray-200 hover:shadow-xl transition-all duration-300">
                  <p><strong>Name:</strong> {restaurant.name}</p>
                  <p><strong>Address:</strong> {restaurant.address}</p>
                  <p><strong>Special For:</strong> {restaurant.specialfor}</p>
                </div>
              ))}
            </div>
          ) : (
            <p className="text-gray-600">No restaurants found.</p>
          )}
        </div>

      </div>
    </div>
  );
}

export default Details;
